import React, { useState, useEffect } from "react";
import { Menu, X, Download } from "lucide-react";
import { Link, useLocation } from "react-router-dom";

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const location = useLocation();

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const menuItems = [
    { label: "Home", href: "#home" },
    { label: "About", href: "#about" },
    { label: "Experience", href: "#experience" },
    { label: "Projects", href: "#projects" },
    { label: "Skills", href: "#skills" },
    { label: "Resume", href: "#resume" },
    { label: "Blog", href: "#blog" },
    { label: "Contact", href: "#contact" },
  ];

  const scrollToSection = (href) => {
    const element = document.querySelector(href);
    if (element) {
      element.scrollIntoView({ behavior: "smooth" });
      setIsMenuOpen(false);
    }
  };

  // Decide text color: dark for light pages, light for home top section
  const getTextColor = () => {
    if (isScrolled || location.pathname !== "/") {
      return "text-slate-800 hover:text-emerald-600"; // dark on light bg
    }
    return "text-slate-300 hover:text-emerald-400"; // light on dark bg
  };

  return (
    <header
      className={`fixed top-0 w-full z-50 transition-all duration-300 ${isScrolled || location.pathname !== "/"
          ? "bg-white shadow-md"
          : "bg-slate-900/95 backdrop-blur-md"
        }`}
    >
      <nav className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          {/* Desktop Navigation */}
          <div className="hidden md:block w-full">
            <div className="flex justify-center items-baseline space-x-8">
              {menuItems.map((item) => (
                <button
                  key={item.label}
                  onClick={() => scrollToSection(item.href)}
                  className={`px-3 py-2 text-sm font-medium transition-colors duration-200 ${getTextColor()}`}
                >
                  {item.label}
                </button>
              ))}

              {/* Fun Facts link (always last) */}
              <Link
                to="/funfacts"
                className={`px-3 py-2 text-sm font-medium transition-colors duration-200 whitespace-nowrap ${getTextColor()}`}
              >
                Fun Facts
              </Link>

              {/* Resume button */}
              <button
                onClick={() => window.open("/resume.pdf", "_blank")}
                className="bg-emerald-500 hover:bg-emerald-600 text-white px-4 py-2 rounded-md text-sm font-medium transition-colors duration-200 flex items-center gap-2"
              >
                <Download size={16} />
                Resume
              </button>
            </div>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className={`transition-colors duration-200 ${getTextColor()}`}
            >
              {isMenuOpen ? <X size={24} /> : <Menu size={24} />}
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        {isMenuOpen && (
          <div className="md:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1 bg-white shadow-md rounded-lg mt-2">
              {menuItems.map((item) => (
                <button
                  key={item.label}
                  onClick={() => scrollToSection(item.href)}
                  className="block px-3 py-2 text-base font-medium w-full text-left text-slate-800 hover:text-emerald-600 transition-colors duration-200"
                >
                  {item.label}
                </button>
              ))}

              {/* Fun Facts */}
              <Link
                to="/funfacts"
                onClick={() => setIsMenuOpen(false)}
                className="block px-3 py-2 text-base font-medium w-full text-left text-slate-800 hover:text-emerald-600 transition-colors duration-200 whitespace-nowrap"
              >
                Fun Facts
              </Link>

              {/* Resume button */}
              <button
                onClick={() => window.open("/resume.pdf", "_blank")}
                className="bg-emerald-500 hover:bg-emerald-600 text-white px-3 py-2 rounded-md text-base font-medium w-full text-left transition-colors duration-200 flex items-center gap-2 mt-2"
              >
                <Download size={16} />
                Resume
              </button>
            </div>
          </div>
        )}
      </nav>
    </header>
  );
};

export default Header;
